import React from "react";
import LetterGrid from "../components/LetterGrid";

function Wordle() {

    const ex = ["abcde", "where", "salet", "argue"]

    return (
        <div>
            <h1>Wordle!</h1>
            <LetterGrid pastGuesses={ex} currentGuess="bru" answer="cheat"/>
        </div>
    )
}

export default Wordle;
